        <p className="text-end">{userCalcs.commissionProfit(data.balance, data.commissioned)}: ربح العمولة</p>
        <p className="text-end">{userCalcs.overallProfit(data.balance, data.currentUser, data.commissioned)}: اجمالي الربح</p> */}
      </main>
